        }

        [TestCase(1)]
        public async Task GetSectorProfileAsync_SectorFound(int id)
        {
            //Assert
            _repoWrapper
                .Setup(x => x.GoverningBodySector.GetFirstOrDefaultAsync(
                    It.IsAny<Expression<Func<GBSector, bool>>>(),
                    It.IsAny<Func<IQueryable<GBSector>, IIncludableQueryable<GBSector, object>>>()))
                .ReturnsAsync(new GBSector());

            SectorDTO mappedSector = CreateSectorDTO();
            _mapper
                .Setup(x => x.Map<GBSector, SectorDTO>(It.IsAny<GBSector>()))
                .Returns(mappedSector);

            //Act
            var result = await _service.GetSectorProfileAsync(id);

            //Assert
            Assert.IsNotNull(result);
            Assert.AreEqual(1, result.Administration.Count());
            Assert.AreEqual(mappedSector.Documents, result.Documents);
            Assert.AreEqual(mappedSector, result.Sector);
            Assert.IsNotNull(result.Head);
        }

